inline int PtInRegion(_rgn* pRgn, int pn, int Latitude, int Longitude)
{
	int nStartP, nEndP;
	int fX0, fY0 = Latitude;
	int nCrossCount = 0;

	for (int i = 0; i < pn; i++)
	{
		nStartP = i;
		if(i + 1 == pn)
			nEndP = 0;
		else
			nEndP = i + 1;

		if(Longitude > max(pRgn->pts[nStartP][0], pRgn->pts[nEndP][0])) //right
			continue;
		else if(Latitude > max(pRgn->pts[nStartP][1], pRgn->pts[nEndP][1])) //on   top   of
			continue;
		else if(Latitude < min(pRgn->pts[nStartP][1], pRgn->pts[nEndP][1])) //under
			continue;
		else if((Latitude == pRgn->pts[nStartP][1] && Longitude == pRgn->pts[nStartP][0]) ||
			(Latitude == pRgn->pts[nEndP][1] && Longitude == pRgn->pts[nEndP][0]))
			return   2; //climax
		else if(Latitude == pRgn->pts[nStartP][1] && Latitude == pRgn->pts[nEndP][1])//parallel
		{
			//if(Longitude   >   max(pRgn->pts[nStartP][0],   pRgn->pts[nEndP][0]))   
			//  continue   ; //right   
			//else     
			if(Longitude < max(pRgn->pts[nStartP][0], pRgn->pts[nEndP][0]) &&
				Longitude > min(pRgn->pts[nStartP][0], pRgn->pts[nEndP][0]))
				return 3; //on   edge
			else //Longitude   <   min(pRgn->pts[i][0],   pRgn->pts[i   +   1][0])   
			{
				if(i - 1 < 0)
					nStartP = pn - 1;
				else
					nStartP = i - 1;

				if(i + 2 >= pn)
					nEndP = i + 2 - pn;
				else
					nEndP = i + 2;

				i++;
				if(Latitude > max(pRgn->pts[nStartP][1], pRgn->pts[nEndP][1]) ||
					Latitude < min(pRgn->pts[nStartP][1], pRgn->pts[nEndP][1]))
					{
						nCrossCount ++;
						continue;
					}
				else continue;
			}   
		}
		else if(Latitude == pRgn->pts[nStartP][1])//but   Latitude   !=   pRgn->pts[nEndP][1]
		{
			if(Longitude < pRgn->pts[nStartP][0])
				nCrossCount ++;
			else
				continue;
		}
		else if(Latitude == pRgn->pts[nEndP][1])//but   Latitude   !=   pRgn->pts[nStartP][1]
		{
			if(Longitude > pRgn->pts[nEndP][0])
				continue;
			nStartP = i;   
			if(i + 2 >= pn)
				nEndP = i + 2 - pn;
			else
				nEndP = i + 2;

			if(Latitude > max(pRgn->pts[nStartP][1], pRgn->pts[nEndP][1]) ||
				Latitude < min(pRgn->pts[nStartP][1], pRgn->pts[nEndP][1]))
			{
				nCrossCount++;/////////////////////////
				continue;
			}
			else
				continue;
		}
		else //if (Latitude   <   max(pRgn->pts[nStartP][1],   pRgn->pts[nEndP][1])   &&
			//         (Latitude   >   min(pRgn->pts[nStartP][1],   pRgn->pts[nEndP][1]))   &&   
			//       (Longitude   <=   max(pRgn->pts[nStartP][0],   pRgn->pts[nEndP][0]))   
		{
			if(Longitude <= min(pRgn->pts[nStartP][0], pRgn->pts[nEndP][0]))
			{
				nCrossCount ++;
				continue;
			}

			//   get   cross-point.     formula:   x0   =   x1   +   (x2   -   x1)   *   (y0   -   y1)   /   (y2   -   y1)   
			fX0 = pRgn->pts[nStartP][0] + (pRgn->pts[nEndP][0] - pRgn->pts[nStartP][0]) * (Latitude - pRgn->pts[nStartP][1]) / (pRgn->pts[nEndP][1] - pRgn->pts[nStartP][1]);
			if(fX0 == Longitude) //edge
				return 3;
			else if(fX0 > Longitude) //right
			{
				nCrossCount++;
				continue;
			}
			else //   fX0   <   Longitude //left
				continue;
		}
	} // end   for   (int   i   =   0;   i   <   pn   -   1;   i++)

	return nCrossCount % 2; //0   or   1
}

