STDMETHODIMP CXGeoTools::CXGeoPoint::ConvertDatium(int newVal)
{
	if((newVal == 1 && m_Datium == 0) || (newVal == 0 && m_Datium == 1))
	{
		if(isChinaDatium((int)(m_latitude * 1000000), (int)(m_longitude * 1000000)))
		{
			UINT x, y;
			double n1, n2;
			double latitude, longitude;

			n1 = m_longitude * 40;
			n2 = m_latitude * 10;

			x = (UINT)floor(n1) - 2880;
			y = (UINT)floor(n2) - 100;

			if(!newVal)
			{
				n1 -= s_LPMap[y][x][0] / 2500.0;
				n2 -= s_LPMap[y][x][1] / 10000.0;

				x = (UINT)floor(n1) - 2880;
				y = (UINT)floor(n2) - 100;
			}

			n1 -=  x + 2880;
			n2 -= y + 100;

			longitude = (s_LPMap[y][x + 1][0] * n1 + s_LPMap[y][x][0] * (1 - n1)) * (1 - n2) + (s_LPMap[y + 1][x + 1][0] * n1 + s_LPMap[y + 1][x][0] * (1 - n1)) * n2;
			latitude = (s_LPMap[y][x + 1][1] * n1 + s_LPMap[y][x][1] * (1 - n1)) * (1 - n2) + (s_LPMap[y + 1][x + 1][1] * n1 + s_LPMap[y + 1][x][1] * (1 - n1)) * n2;

			if(newVal)
			{
				m_longitude += floor(longitude + 0.5) / 100000;
				m_latitude += floor(latitude + 0.5) / 100000;
			}else
			{
				m_longitude -= floor(longitude + 0.5) / 100000;
				m_latitude -= floor(latitude + 0.5) / 100000;
			}
		}

		m_Datium = newVal;
	}

	return S_OK;
}

inline double rad(double d)
{
	return d * 3.1415926535898 / 180.0;
} 

STDMETHODIMP CXGeoTools::CXGeoPoint::GetDistance(IXGeoPoint* pTo, double* pVal)
{
	CXGeoPoint* pEnd = (CXGeoPoint*)pTo;
	if(!pEnd)return S_OK;

	double radLat1 = rad(m_latitude);
	double radLat2 = rad(pEnd->m_latitude);
	double a = radLat1 - radLat2;
	double b = rad(m_longitude) - rad(pEnd->m_longitude);
	double s = 2 * asin(sqrt(pow(sin(a/2),2) + cos(radLat1)*cos(radLat2)*pow(sin(b/2),2)));
	s = s * 6378137;

	*pVal = s;

//	*pVal = sqrt(pow(m_latitude - pEnd->m_latitude,2) + pow(m_longitude - pEnd->m_longitude,2)) * 100000;

	return S_OK;
}

extern CXStringA s_pathRuntime;

class _rgnNode
{
public:
	_rgnNode()
	{}

public:
	POSITION posAccess;
	_rgn *pRgn;
};

static CCriticalSection s_csRange;
static CRBMap<int, _rgnNode> s_mapItems;
static CAtlList<POSITION> s_listAccess;
static UINT s_nRgnCount;
static FILE* s_rgnFile = NULL;
static int* s_rgnPos = NULL;

_rect* s_prs;

static void rgn_removeNode(POSITION pos)
{
	CRBMap<int, _rgnNode>::CPair* pPair = (CRBMap<int, _rgnNode>::CPair*)pos;

	free(pPair->m_value.pRgn);
	s_listAccess.RemoveAt(pPair->m_value.posAccess);
	s_mapItems.RemoveAt(pPair);
}

static _rgn* getRange(int id)
{
	CRBMap<int, _rgnNode>::CPair* pPair = s_mapItems.Lookup(id);

	if(!pPair)
	{
		if(s_mapItems.GetCount() > 128)
			rgn_removeNode(s_listAccess.GetHead());

		_rgnNode rn;

		rn.pRgn = (_rgn*)malloc(sizeof(int) + s_prs[id].size * sizeof(int) * 2);

		fseek(s_rgnFile, s_rgnPos[id], 0);

		fread(rn.pRgn, sizeof(int) + s_prs[id].size * sizeof(int) * 2, 1, s_rgnFile);

		pPair = (CRBMap<int, _rgnNode>::CPair*)s_mapItems.SetAt(id, rn);
	}else
		s_listAccess.RemoveAt(pPair->m_value.posAccess);		

	pPair->m_value.posAccess = s_listAccess.AddTail(pPair);

	return pPair->m_value.pRgn;
}

static BOOL checkFile()
{
	UINT mk[2] = {0,0};
	UINT i, pos;

	if(s_rgnFile)return TRUE;

	s_rgnFile = fopen(s_pathRuntime + "boundary.dat", "rb");
	if( !s_rgnFile )
		return FALSE;

	if(fread(&mk, sizeof(int) + sizeof(WORD), 1, s_rgnFile) < 1)
	{
		fclose(s_rgnFile);
		s_rgnFile = NULL;
		return FALSE;
	}

	s_nRgnCount = mk[1];
	s_prs = (_rect*)malloc(sizeof(_rect) * s_nRgnCount);
	if(!s_prs)
	{
		fclose(s_rgnFile);
		s_rgnFile = NULL;
		return FALSE;
	}

	if(fread(s_prs, sizeof(_rect), s_nRgnCount, s_rgnFile) < s_nRgnCount)
	{
		free(s_prs);
		s_prs = NULL;

		fclose(s_rgnFile);
		s_rgnFile = NULL;
		return FALSE;
	}

	s_rgnPos = (int*)malloc(sizeof(int) * s_nRgnCount);
	if(!s_rgnPos)
	{
		free(s_prs);
		s_prs = NULL;

		fclose(s_rgnFile);
		s_rgnFile = NULL;
		return FALSE;
	}

	pos = sizeof(int) + sizeof(WORD) + sizeof(_rect) * s_nRgnCount;

	for(i = 0; i < s_nRgnCount; i ++)
	{
		s_rgnPos[i] = pos;
		pos += sizeof(int) + s_prs[i].size * sizeof(int) * 2;
	}

	return TRUE;
}

static int GetCityID(int Latitude, int Longitude)
{
	UINT i;

	s_csRange.Enter();

	if(!checkFile())
	{
		s_csRange.Leave();
		return 0;
	}

	for(i = 0; i < s_nRgnCount; i ++)
	{
		if(Longitude >= s_prs[i].pts[0][0] && Longitude <= s_prs[i].pts[1][0] &&
			Latitude >= s_prs[i].pts[0][1] && Latitude <= s_prs[i].pts[1][1] )
		{
			_rgn* pRgn = getRange(i);

			if(pRgn)
				if(PtInRegion(pRgn, s_prs[i].size, Latitude, Longitude))
				{
					s_csRange.Leave();
					return pRgn->cityid;
				}
		}
	}

	s_csRange.Leave();

	return 0;
}

int cn_cmp(const void* p1, const void* p2)
{
	return *(const int*)p1 - *(const int*)p2;
}

STDMETHODIMP CXGeoTools::CXGeoPoint::CityInfo(VARIANT* pVal)
{
	CComSafeArray<VARIANT> bstrArray;
	VARIANT* pVar;
	HRESULT hr;
	int cityid;
	CityInfoStruct* pcn;

	hr = bstrArray.Create(5);
	if(FAILED(hr))return hr;

	pVar = (VARIANT*)bstrArray.m_psa->pvData;

	cityid = GetCityID((int)(m_latitude * 1000000), (int)(m_longitude * 1000000));

	pVar[0].vt = VT_I4;
	pVar[0].intVal = 0;

	if(cityid && (pcn = (CityInfoStruct*)bsearch(&cityid, s_cityname, sizeof(s_cityname) / sizeof(s_cityname[0]), sizeof(s_cityname[0]), cn_cmp)))
	{
		if((cityid % 10000 != 0) && (cityid % 100 == 0) && (pcn[1].id == cityid + 1))
			pcn ++;

		pVar[0].intVal = pcn->id;

		pVar[1].vt = VT_BSTR;
		pVar[1].bstrVal = ::SysAllocString(pcn->name);

		pVar[2].vt = VT_BSTR;
		pVar[2].bstrVal = ::SysAllocString(pcn->sname);

		pVar[3].vt = VT_BSTR;
		pVar[3].bstrVal = ::SysAllocString(pcn->ename);

		pVar[4].vt = VT_BSTR;
		pVar[4].bstrVal = ::SysAllocString(pcn->path);
	}

	pVal->vt = VT_ARRAY | VT_VARIANT;
	pVal->parray = bstrArray.Detach();

	return S_OK;
}
